-[AppDelegate application:didFinishLaunc.sourceCode:
{
  // Override point for customization after application launch.
  ViewController *vc = [ViewController new]; //[[ViewController alloc] init];
  [vc setDelegate:self];
  [ViewController sharedInstance];
  [self setWindow:[[UIWindow alloc]
                      initWithFrame:CGRectMake(
                                        0, 0,
                                        [UIScreen mainScreen].bounds.size.width,
                                        [UIScreen mainScreen]
                                            .bounds.size.height)]];
  [self.window setRootViewController:vc];
  [self.window makeKeyAndVisible];
  [[NSNotificationCenter defaultCenter]
      addObserver:self
         selector:@selector(onViewControllerDidLoadNotification:)
             name:kNotificationViewControllerDidLoad
           object:nil];
  [[ViewController alloc]
      initWithRootViewControllerURL:@"KDSJ://KDLoginViewController"];
  //  [[ViewController alloc] openURL:@"KDSJ://KDHomeViewController"];
  [[NoMethodUsedClass alloc] init];
  return YES;
}

